//index.js
//获取应用实例
const app = getApp()

Page({
  
  data: {
    //  svg_cafei: 'data:image/svg+xml;base64,',
    
    //svg_piao='data:image/svg+xml;base64,',
     svg_liwu:'data:image/svg+xml;base64,',
    nav_name: [
      { cn: '现在下单', en: 'ORDER NOW', svg: 'data:image/svg+xml;base64,'}, 
      { cn: '咖啡钱包', en: 'COFFEE WALLET', svg: 'data:image/svg+xml;base64,'}, 
      { cn: '送他咖啡', en: 'SEND COFFEE', svg: 'data:image/svg+xml;base64,'}
              ],
    imgs:['1','2','3'],
    indicatorDots: true,
    autoplay: true,
    interval: 5000,
    imgheights: [],
    //图片宽度
    imgwidth: 750,

  },
  //事件处理函数
  bindViewTap: function() {
    wx.navigateTo({
      url: '../logs/logs'
    })
  },
  onLoad: function () {
    console.log('加载完毕');
  },
  imageLoad: function (e) {
    //获取图片真实宽度
    var imgwidth = e.detail.width,
      imgheight = e.detail.height,
      //宽高比
      ratio = imgwidth / imgheight;
    console.log(imgwidth, imgheight)
    //计算的高度值
    var viewHeight = 750 / ratio;
    var imgheight = viewHeight
    var imgheights = this.data.imgheights
    //把每一张图片的高度记录到数组里
    imgheights.push(imgheight)
    this.setData({
      imgheights: imgheights,
    })
  },
  bindchange: function (e) {
    console.log(e.detail.current)
    this.setData({ current: e.detail.current })
  }
})
